When I was a kid I was incredibly debilitatingly shy. I couldn't even ask a teacher- in a school of literally less than 200 students prek to 8th grade whose entire families knew each other- if I could use the bathroom. If I had trouble learning something, I would rather study 3 hours than ask a 30 second question. But also when I was young, I loved colors. I had tank tops and shorts in every color of the rainbow. If it wasn't a hand me down- it was colorful. But it wasn't until I was inspired by photos of Harajuku that I realised that clothes could mean more than just a pretty color. My rainbow clothes became my confidence, my creativity, my passion, and my dream. I cannot imagine the person I would be without it. 
